jQuery.itxforminit=function(){
	$.itxinit();
	$('a,input[type=submit],button').bind('focus',function(){if(this.blur){this.blur();}});
	$('input.error').bind('focus',function(){$(this).removeClass("error");});
	$("div.fielddiv").hover(function(){$(this).addClass("active");},function(){$(this).removeClass("active");});
	$('form dl dd').find('.item:last').each(function(){$(this).css({'margin-right':'0'})});
	//表单验证
	$('input[validation=number],input[validation=money],input[validation=english],input[validation=mobile],input[validation=email],input[validation=date]').bind('blur',function(){
		var tmptxt=$(this).val();      
		switch($(this).attr('validation')){
			case 'number':{$(this).val(tmptxt.replace(/\D|^0/g,''));};break;
			case 'money':{$(this).val(tmptxt.replace(/[a-z|A-Z|\u4E00-\u9FA5]/ig,''));};break;
			case 'english':{$(this).val(tmptxt.replace(/[\u4E00-\u9FA5]/ig,''));};break;
			case 'mobile':{$(this).val(tmptxt.replace(/\D|^0/g,''));};break;
			case 'email':{$(this).val(tmptxt.replace(/[\u4E00-\u9FA5]/ig,''));};break;
		}
	})
}





