$('div.stepdiv:first').show();
var steps=$("div.stepdiv").length;
if(steps>1){$('footer button[name=next]').show();}else{$('footer button[name=save]').show();}

//返回上一步
$("footer button[name=prev]").bind("click",function(){
	var step=parseInt($("div.stepdiv:visible").attr('step'));
		gotoForm(step,step-1)
});

function gotoForm(o,n){
	$('#scroll-wrapper').loadMask(true)
	function callback(){
		if(steps>1){
			switch(parseInt(n)){
				case 1:		{$('footer button[name=next]').fadeIn();};break;
				case steps:	{$('footer button[name=prev],footer button[name=save]').fadeIn();};break;
				default:	{$('footer button[name=prev],footer button[name=next]').fadeIn();};break;
			}
		}
		if(myScroll){myScroll.scrollToElement('form',500);}
	}
	if($('div.stepdiv[step='+n+']').length>0){
		$('footer button').hide();
		if(n>o){
			$('div.stepdiv').slideUp("slow","easeInQuint");
			$('div.stepdiv[step='+n+']').show("fast","easeOutQuint",callback)
		}else{
			$('div.stepdiv').slideUp("slow","easeOutQuint");
			$('div.stepdiv[step='+n+']').show("fast","easeInQuint",callback)
		}
	}
	$('#scroll-wrapper').loadMask(false)
}


function getnewURL(url){window.open(url)}



function includeLinkStyle(url) {
	var link=document.createElement("link");
	link.rel="stylesheet";
	link.type="text/css";
	link.href=url;
	document.getElementsByTagName("head")[0].appendChild(link);
}


